/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground, Props } from 'docz'
import styled from 'styled-components'
import Notify from './Notify'
import Container from '../Container/Container'
import { NotifyContainer } from './notify.example'
import { ThemeProvider } from '../ThemeContext'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "notify"
    }}>{`Notify`}</h1>
    <Props of={Notify} mdxType="Props" />
    <h2 {...{
      "id": "default"
    }}>{`Default`}</h2>
    <Playground __position={1} __code={'<ThemeProvider>\n  <NotifyContainer>\n    {messages => (\n      <Notify uid=\"notify\" position=\"top-left\">\n        {messages.map(m => (\n          <Container radius=\"rounded\" key={m.id}>\n            {m.message} :)\n          </Container>\n        ))}\n      </Notify>\n    )}\n  </NotifyContainer>\n</ThemeProvider>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      styled,
      Notify,
      Container,
